    state = {
        steps: ['Channel', 'Message', 'Segmentation', 'Scheduling', 'Overview'],
    }

    render() {
        const { steps } = this.state
        return (
            <WrapComponents>
                <Stepper steps={steps} activeStep={4} />
                <div className="section">
                    <SmallHeading>Cmapaign Details</SmallHeading>
                </div>
                <div className="section">
                    <SmallHeading>Cmapaign Details</SmallHeading>
                </div>
            </WrapComponents>
        )
    }
}

